INSERT INTO `answer` VALUES (26, 31, '当然可以！如果你喜欢模拟经营类型的游戏，我强烈推荐《模拟城市：明日》（SimCity: Tomorrow）。这款游戏在2019年发布，是《模拟城市》系列的最新作品。它采用了虚幻引擎5技术，提供了更加真实的物理效果和环境。\n\n以下是《模拟城市：明日》的一些关键特点：\n\n1. **高度自定义**：玩家可以完全控制城市的各个方面，包括建筑、道路、公共设施等。\n2. **智能系统**：游戏中的AI会根据玩家的决策自动调整城市的发展方向，增加了游戏的复杂性和挑战性。\n3. **实时动态**：游戏中的天气、人口变化、资源供应等因素都会对城市产生影响，需要玩家进行实时管理。\n4. **多样化的任务和成就**：游戏中有多种任务和成就等待玩家完成，增加了游戏的趣味性和可玩性。\n5. **多人模式**：支持多人在线合作，可以让玩家与朋友一起管理和扩展城市。\n\n如果你对模拟经营类游戏感兴趣，或者想要体验一款全新的游戏，那么《模拟城市：明日》绝对值得一试。', 0, 50, 50, NULL, b'0', b'1', '2025-01-16 16:25:13');
INSERT INTO `answer` VALUES (27, 31, '当然可以！如果你喜欢策略和模拟经营的游戏，我会推荐《模拟城市：明日》（SimCity: Tomorrow）。这款游戏以未来城市为主题，玩家需要管理一座城市的各个方面，包括交通、环境、经济等。游戏的创新之处在于其高度可定制性，你可以根据自己的喜好调整城市的布局和政策，体验不同的城市建设风格。\n\n另外，《模拟城市5》也是一个非常受欢迎的选择，它提供了丰富的细节和深度的模拟功能，适合那些对城市规划和管理感兴趣的玩家。这两款游戏都能提供一个充满挑战和乐趣的城市建设体验。希望你会喜欢！', 1, 50, 50, NULL, b'1', b'1', '2025-01-16 16:27:44');
