INSERT INTO `answer` VALUES (54, 43, '在遥远的未来，地球上的科技已经高度发达。人类发明了一种名为“星际旅行”的技术，可以瞬间跨越银河系。主人公李明是一名年轻的科学家，他梦想着探索未知的宇宙，寻找生命存在的证据。\n\n一天，李明接到了一个神秘的电话，对方告诉他有一个星球上可能存在着智慧生命。兴奋不已的李明立刻报名参加星际旅行任务，与他的团队一起踏上了一场充满冒险和挑战的旅程。\n\n经过数月的太空飞行，他们终于抵达了目标星球。然而，当他们到达', 0, 50, 50, NULL, b'1', b'1', '2025-03-20 17:18:48');
INSERT INTO `answer` VALUES (55, 43, '在一个遥远的小镇上，住着一位名叫小明的孩子。他拥有一双明亮的眼睛和一颗好奇的心。一天，小明在森林中遇到了一只受伤的小鸟，小鸟向他求助，请求帮助它回到自己的家。小明毫不犹豫地答应了，并用自己收集的花瓣和草药为小鸟疗伤。经过几天的努力，小鸟终于恢复了健康，并感激地飞回了自己的巢穴。从此，小明不仅学会了关心他人，还结识了许多新朋友。这个故事告诉我们，善良和爱心是世界上最美好的品质。', 1, 50, 50, NULL, b'1', b'1', '2025-03-20 17:20:27');
