INSERT INTO `blog` VALUES (1, '2024年度游戏推荐', 'https://img1.baidu.com/it/u=3325532605,4237549398&fm=253&fmt=auto&app=120&f=JPEG?w=1094&h=500', '# 2024年度游戏推荐\n\n![niandu.jpeg](https://img1.baidu.com/it/u=3325532605,4237549398&fm=253&fmt=auto&app=120&f=JPEG?w=1094&h=500)\n\n### 1 黑神话悟空\n\n《黑神话：悟空》是由[杭州游科互动科技有限公司](https://baike.baidu.com/item/杭州游科互动科技有限公司/62729290?fromModule=lemma_inlink)开发 [37]，[浙江出版集团数字传媒有限公司](https://baike.baidu.com/item/浙江出版集团数字传媒有限公司/4602701?fromModule=lemma_inlink)出版的西游题材[单机](https://baike.baidu.com/item/单机/8596633?fromModule=lemma_inlink)动作[角色扮演游戏](https://baike.baidu.com/item/角色扮演游戏/1730573?fromModule=lemma_inlink) [39]。\n\n该作以中国[四大名著](https://baike.baidu.com/item/四大名著/8376?fromModule=lemma_inlink)之一、[吴承恩](https://baike.baidu.com/item/吴承恩/18713182?fromModule=lemma_inlink)所著长篇小说《[西游记](https://baike.baidu.com/item/西游记/5723?fromModule=lemma_inlink)》为背景设定，借用《西游记》自身的故事作为前传，讲述取经之后[孙悟空](https://baike.baidu.com/item/孙悟空/5576?fromModule=lemma_inlink)因放弃佛位引发天庭对其再次征伐之后的故事。在游戏中，玩家将扮演一位“[天命人](https://baike.baidu.com/item/天命人/64797341?fromModule=lemma_inlink)”，为了探寻昔日传说的真相，踏上一条充满危险与惊奇的西游之路 [31]。\n\n![黑神话悟空](https://img1.baidu.com/it/u=4035448853,1822428721&fm=253&fmt=auto&app=120&f=JPEG?w=1401&h=800)\n\n![](https://img0.baidu.com/it/u=1102921704,1813998125&fm=253&fmt=auto&app=138&f=JPEG?w=1018&h=500)\n\n### 2 最终幻想7重生\n\n《最终幻想VII：重生》是[史克威尔·艾尼克斯](https://baike.baidu.com/item/史克威尔·艾尼克斯/4661080?fromModule=lemma_inlink)制作发行的一款动作角色扮演游戏，于2024年2月29日在PS5平台独占发售，是《最终幻想VII》重制三部曲的第二部作品，《[最终幻想VII：重制版](https://baike.baidu.com/item/最终幻想VII：重制版/24209389?fromModule=lemma_inlink)》的续作， [3]于2025年1月23日登陆Epic和Steam。 [10]\n\n游戏以原作《[最终幻想Ⅶ](https://baike.baidu.com/item/最终幻想Ⅶ/8528640?fromModule=lemma_inlink)》中直到“忘却之都”为止的剧情为基础，加入全新原创内容。讲述了克劳德一行人脱离魔晄都市米德加，跨越命运之墙，迈入未知的荒野旅程。\n\n![最终幻想7重生](http://106.14.45.117:8055/common/upload1/download?name=bd4a845f-4279-43e5-9b14-a0aa0e7b07e8最终幻想7重生.jfif)\n\n![u=682609959,1160845828&fm=253&fmt=auto&app=120&f=JPEG (889×500) (baidu.com)](https://img1.baidu.com/it/u=682609959,1160845828&fm=253&fmt=auto&app=120&f=JPEG?w=889&h=500)\n\n\n\n![](https://img0.baidu.com/it/u=1234475475,3008295595&fm=253&fmt=auto&app=120&f=JPEG?w=839&h=500)\n\n\n\n### 3  宇宙机器人\n\n《宇宙机器人》（英文名：Astro Bot）是由索尼PlayStation Studios旗下[Team ASOBI](https://baike.baidu.com/item/Team ASOBI/65146700?fromModule=lemma_inlink)开发 [8]、索尼互动娱乐发行 [9]的动作冒险游戏。2024年9月6日，该作在PlayStation 5平台推出 [6]。\n\n该作是系列游戏《宇宙机器人》的第三部作品 [1]，主角是名为Astro的机器人，其形象最早出自2016年的游戏《Playroom VR》 [26]。该游戏利用PS5 DualSense手柄的触觉反馈和自适应扳机功能 [30]，玩家可在50多个星球上展开新的冒险，\n\n![](https://img0.baidu.com/it/u=525675743,471381141&fm=253&fmt=auto&app=120&f=JPEG?w=729&h=410)\n\n\n\n### 4 艾尔登法环：黄金树幽影\n\n《艾尔登法环：黄金树幽影》是游戏《[艾尔登法环](https://baike.baidu.com/item/艾尔登法环/57233820?fromModule=lemma_inlink)》中的唯一DLC，于2024年6月21日正式推出。 [1-2] [8]\n\n以“[幽影之地](https://baike.baidu.com/item/幽影之地/64571439?fromModule=lemma_inlink)”为舞台，伴随着多种新增要素，交织出另一段故事\n\n![](https://bkimg.cdn.bcebos.com/pic/4b90f603738da97739129ad77509ef198618377a458c?x-bce-process=image/format,f_auto/resize,m_lfit,limit_1,h_300)\n\n\n\n### 5 小丑牌\n\n《小丑牌》是一款由加拿大独立游戏开发者LocalThunk制作的游戏。\n\n本作于2024年2月20日于PC、[Nintendo Switch](https://baike.baidu.com/item/Nintendo Switch/20156470?fromModule=lemma_inlink)、[Play Station](https://baike.baidu.com/item/Play Station/2386777?fromModule=lemma_inlink)发售，Steam版售价54元。\n\n![](https://bkimg.cdn.bcebos.com/pic/7dd98d1001e93901213f6513fdb543e736d12f2e38de?x-bce-process=image/format,f_auto/resize,m_lfit,limit_1,h_669)\n\n\n\n### 6 暗喻幻想：ReFantazio\n\n《暗喻幻想：ReFantazio》是一款由[ATLUS](https://baike.baidu.com/item/ATLUS/4170999?fromModule=lemma_inlink)公司制作的多平台[角色扮演游戏](https://baike.baidu.com/item/角色扮演游戏/1730573?fromModule=lemma_inlink) [1-2]，于2024年10月11日发售。 [1-2]\n\n游戏讲述了一位少年被卷入国王遭遇暗杀后，突然开始的选举中，成为了新王候选人的故事。\n\n![](https://bkimg.cdn.bcebos.com/pic/5ab5c9ea15ce36d3d539b9d50baa2d87e950342a1b87?x-bce-process=image/format,f_auto/resize,m_lfit,limit_1,h_720)\n\n', '2024年度游戏推荐', b'1', b'1', b'1', b'1', '2025-02-27 22:20:06', '2025-02-27 22:20:06', 5, 12, 0, 1, b'1', '', 1);
INSERT INTO `blog` VALUES (2, '分享网站', 'https://i0.hdslb.com/bfs/bangumi/image/58ba200c4205e00cf662800f942d547270dc1f91.png@349w_465h.webp', '[](data:image/jpeg;base64,)\n[bilibili](https://www.bilibili.com/)', '![](data:image/jpeg;base64,)\n[](https://space.bilibili.com/37974444)', b'1', b'0', b'0', b'1', '2025-02-27 22:34:48', '2025-03-16 22:17:17', 16, 12, 0, 3, b'0', '', 1);
INSERT INTO `blog` VALUES (3, '智能游戏资源社区项目技术栈', 'http://101.34.137.166:8055/common/upload1/download?name=adc658e0-fe56-429b-9258-c376dab747aaSnipaste_2025-03-05_21-15-06.png', '![](http://106.14.45.117:8090/admin/download?name=)\n<p align=\"center\">\n	<a href=\"https://github.com/Fantasy0521/Fantasy-Blog/tree/master\" target=\"_blank\">\n		\n	</a>\n</p>\n<p align=\"center\">\n	<img src=\"https://img.shields.io/badge/JDK-1.8+-orange\">\n	<img src=\"https://img.shields.io/badge/SpringBoot-2.7.9-brightgreen\">\n	<img src=\"https://img.shields.io/badge/mybatis--plus-3.4.3-yellowgreen\">\n	<img src=\"https://img.shields.io/badge/Vue-2.6.11-brightgreen\">\n</p>\n\n\n\n## 简介\n\n\n本着『前后端分离，人不分离』的要领，开发了此基于 Spring Boot + Vue 前后端的智能游戏资源社区\n\n## 主要功能\n\n前台：\n1. 游戏资源推荐帖\n2. 游戏库\n3. 游戏发布动态\n4. 游戏交流区\n5. 游戏资源求助\n6. 智能游戏推荐助手：Fantasy Gpt\n\n后台：\n1. 游戏资源帖管理\n2. 游戏库管理\n3. 评论管理\n4. 分类和标签管理\n5. 动态管理\n6. Gpt管理：关键词管理，问答管理，算法优化\n7. 系统日志管理\n8. 访客统计\n\n\n## 后端\n\n1. 核心框架：[Spring Boot](https://github.com/spring-projects/spring-boot)\n2. 持久层框架：[MybatisPlus](https://baomidou.com/pages/24112f/)\n3. 分页插件：[PageHelper](https://github.com/pagehelper/Mybatis-PageHelper)\n4. NoSQL缓存：[Redis](https://github.com/redis/redis)(暂未使用)\n5. Markdown 转 HTML：[commonmark-java](https://github.com/commonmark/commonmark-java)\n6. 离线 IP 地址库：[ip2region](https://github.com/lionsoul2014/ip2region)\n7. 定时任务：[quartz](https://github.com/quartz-scheduler/quartz)\n8. UserAgent 解析：[yauaa](https://github.com/nielsbasjes/yauaa)\n\n基于 JDK8 开发，8以上要添加依赖：\n\n```xml\n<dependency>\n    <groupId>javax.xml.bind</groupId>\n    <artifactId>jaxb-api</artifactId>\n    <version>2.3.0</version>\n</dependency>\n```\n\n## 前端\n\n核心框架：Vue2.x、Vue Router、Vuex\n\nVue 项目基于 @vue/cli4.x 构建\n\nJS 依赖及参考的\ncss：[axios](https://github.com/axios/axios)、[moment](https://github.com/moment/moment)、[nprogress](https://github.com/rstacruz/nprogress)、[v-viewer](https://github.com/fengyuanchen/viewerjs)、[prismjs](https://github.com/PrismJS/prism)、[APlayer](https://github.com/DIYgod/APlayer)、[MetingJS](https://github.com/metowolf/MetingJS)、[lodash](https://github.com/lodash/lodash)、[mavonEditor](https://github.com/hinesboy/mavonEditor)、[echarts](https://github.com/apache/echarts)、[tocbot](https://github.com/tscanlin/tocbot)、[iCSS](https://github.com/chokcoco/iCSS)\n\n备注: 本人并未对此开源项目的前端代码进行修改\n\n### 后台 UI\n\n后台 CMS 部分基于 [vue-admin-template](https://github.com/PanJiaChen/vue-admin-template)\n二次修改后的 [my-vue-admin-template](https://github.com/Naccl/my-vue-admin-template)\n模板进行开发（于2021年11月1日重构过一次，[重构 commit](https://github.com/Naccl/NBlog/commit/b33641fe34b2bed34e8237bacf67146cd64be4cf)）\n\nUI 框架为 [Element UI](https://github.com/ElemeFE/element)\n\n### 前台 UI\n\n[Semantic UI](https://semantic-ui.com/)：主要使用，页面布局样式，个人感觉挺好看的 UI 框架，比较适合前台界面的开发，语义化的 css，前一版博客系统使用过，可惜该框架 Vue\n版的开发完成度不高，见 [Semantic UI Vue](https://semantic-ui-vue.github.io/#/)\n\n[Element UI](https://github.com/ElemeFE/element)：部分使用，一些小组件，弥补了 Semantic UI 的不足，便于快速实现效果\n\n文章排版：基于 [typo.css](https://github.com/sofish/typo.css) 修改\n\n## 快速开始\n\n1. 创建 MySQL 数据库`fantasy-games`，并执行`/Fantasy-Game/fantasy-games.sql`初始化表数据\n2. 修改配置信息`Fantasy-Game/src/main/resources/application.yml`\n3. 安装 Redis 并启动(暂不需要)\n4. 启动后端服务\n5. 分别在`blog-cms`和`blog-view`目录下执行`npm install`安装依赖\n6. 分别在`blog-cms`和`blog-view`目录下执行`npm run serve`启动前后台页面\n', '项目技术栈介绍\n![]()', b'1', b'1', b'1', b'1', '2025-03-02 09:45:11', '2025-03-16 12:44:35', 8, 1000, 5, 3, b'1', '', 1);
INSERT INTO `blog` VALUES (5, '2024年动漫导视', 'https://tse4-mm.cn.bing.net/th/id/OIP-C.fKFPDImOMogykDHeiFUeZQHaEo?w=250&h=180&c=7&r=0&o=5&dpr=1.2&pid=1.7', '### 续作推荐：\n###### 1 无职转生 到了异世界就拿出真本事 第二季\n[无职转生](http://www.bilibili.com/)\n![](https://img1.baidu.com/it/u=1305371274,1351057682&fm=253&fmt=auto&app=120&f=JPEG?w=879&h=500)\n\n###### 2 Re：从零开始的异世界生活\n[Re：从零开始的异世界生活](https://baike.baidu.com/item/Re%EF%BC%9A%E4%BB%8E%E9%9B%B6%E5%BC%80%E5%A7%8B%E7%9A%84%E5%BC%82%E4%B8%96%E7%95%8C%E7%94%9F%E6%B4%BB/18114401?fromModule=lemma_search-box)\n![](https://img2.baidu.com/it/u=2073550392,4150205570&fm=253&fmt=auto&app=120&f=JPEG?w=800&h=500)\n\n### 新作推荐：\n\n###### 1 我心里危险的东西\n《我心里危险的东西》改编自樱井纪雄创作的同名漫画作品。2022年8月2日，官方宣布制作电视动画片的消息 [1]。该片由新锐动画负责制作，于2023年4月2日至6月18日播出，全12集。\n[我心里危险的东西](https://baike.baidu.com/item/%E6%88%91%E5%BF%83%E9%87%8C%E5%8D%B1%E9%99%A9%E7%9A%84%E4%B8%9C%E8%A5%BF/61800516)\n![](https://img0.baidu.com/it/u=29972896,2300630131&fm=253&fmt=auto&app=120&f=JPEG?w=800&h=500)\n\n###### 2 败犬女主太多了！\n《败犬女主太多了！》是雨森たきび著作、伊右群负责插画、GAGAGA文库所属的校园恋爱轻小说。繁体中文版由东立出版社发行。\n[败犬女主太多了](https://baike.baidu.com/item/%E8%B4%A5%E7%8A%AC%E5%A5%B3%E4%B8%BB%E5%A4%AA%E5%A4%9A%E4%BA%86%EF%BC%81/63381834)\n![](https://img1.baidu.com/it/u=2605997499,3940519884&fm=253&fmt=auto&app=120&f=JPEG?w=800&h=500)', '2024 动漫导视 番剧推荐 ', b'1', b'1', b'1', b'1', '2025-03-06 17:06:08', '2025-03-06 17:06:08', 0, 100, 1, 3, b'0', '', 1);
INSERT INTO `blog` VALUES (6, 'Spring Boot 2.6.x整合Swagger(引入knife4j)启动失败报错问题解决', 'https://static1.smartbear.co/swagger/media/assets/images/sw_ov_intro_hero.svg', '问题\nSpring Boot 2.6.x版本引入依赖 springfox-boot-starter (Swagger 3.0) 后，启动容器会报错：\n\nFailed to start bean ‘ documentationPluginsBootstrapper ‘ ; nested exception…\n\n原因\nSpringfox 假设 Spring MVC 的路径匹配策略是 ant-path-matcher，而 Spring Boot 2.6.x版本的默认匹配策略是 path-pattern-matcher，这就造成了上面的报错。\n\n解决方案\n方案一（治标）\n在 application.properties 配置文件中修改mvc的匹配策略：\n\nspring.mvc.pathmatch.matching-strategy=ant-path-matcher\n\n注意：开始的时候我用这个方法的确可以正常启动了，但后来我发现此方法在某些服务启动时会失效！我查了一下才发现这个方法治标不治本，具体如下：\n\n只有在不使用 Spring Boot 的执行器时，此功能才起作用。\n无论配置的匹配策略如何，执行器将始终使用基于路径模式的解析 ( 也就是默认策略 ) 。\n如果您想在 Spring Boot 2.6及更高版本中将其与执行器一起使用，则需要对 Springfox 进行更改。\n\n所以解铃还须系铃人呐！要想彻底解决这个bug，需要修改的是 Springfox 。\n\n方案二（治本）\n\n在你的项目里添加这个 bean ：（加在配置类里就可）\n\n```\n@Bean\npublic static BeanPostProcessor springfoxHandlerProviderBeanPostProcessor() {\n    return new BeanPostProcessor() {\n\n        @Override\n        public Object postProcessAfterInitialization(Object bean, String beanName) throws BeansException {\n            if (bean instanceof WebMvcRequestHandlerProvider || bean instanceof WebFluxRequestHandlerProvider) {\n                customizeSpringfoxHandlerMappings(getHandlerMappings(bean));\n            }\n            return bean;\n        }\n\n        private <T extends RequestMappingInfoHandlerMapping> void customizeSpringfoxHandlerMappings(List<T> mappings) {\n            List<T> copy = mappings.stream()\n                    .filter(mapping -> mapping.getPatternParser() == null)\n                    .collect(Collectors.toList());\n            mappings.clear();\n            mappings.addAll(copy);\n        }\n\n        @SuppressWarnings(\"unchecked\")\n        private List<RequestMappingInfoHandlerMapping> getHandlerMappings(Object bean) {\n            try {\n                Field field = ReflectionUtils.findField(bean.getClass(), \"handlerMappings\");\n                field.setAccessible(true);\n                return (List<RequestMappingInfoHandlerMapping>) field.get(bean);\n            } catch (IllegalArgumentException | IllegalAccessException e) {\n                throw new IllegalStateException(e);\n            }\n        }\n    };\n}\n\n```\n\nOK，启动成功！\n', 'Spring Boot 2.6.x整合Swagger启动失败报错问题解决（治标还治本）\n![](https://static1.smartbear.co/swagger/media/assets/images/sw_ov_intro_hero.svg)', b'1', b'1', b'1', b'1', '2025-03-09 15:33:32', '2023-03-09 16:34:40', 0, 500, 3, 3, b'0', '', 1);
INSERT INTO `blog` VALUES (7, '只狼Sekiro名场面', 'https://tse3-mm.cn.bing.net/th/id/OIP-C.S1VjpQ1g1ZU81YlKnrv9QAHaEK?w=299&h=180&c=7&r=0&o=5&dpr=1.2&pid=1.7', '###### 初遇弦一郎\n![](http://106.14.45.117:8090/admin/download?name=)\n\n###### 萌新之友 赤鬼\n![](http://106.14.45.117:8090/admin/download?name=)\n\n###### 弹刀教主 蝴蝶夫人\n![](http://106.14.45.117:8090/admin/download?name=)\n\n###### 菜鸡 鬼形部\n![](http://106.14.45.117:8090/admin/download?name=)\n\n###### 永真老婆\n![](http://106.14.45.117:8090/admin/download?name=)\n\n', '2019 年度最佳游戏 只狼 高燃名场面\n![只狼Sekiro](https://tse3-mm.cn.bing.net/th/id/OIP-C.S1VjpQ1g1ZU81YlKnrv9QAHaEK?w=299&h=180&c=7&r=0&o=5&dpr=1.2&pid=1.7)', b'1', b'1', b'1', b'1', '2025-03-09 17:12:42', '2025-01-21 15:44:22', 5000, 111, 1, 1, b'0', '', 1);
INSERT INTO `blog` VALUES (8, 'Skywalking介绍和搭建', 'https://skywalking.apache.org/images/logo.svg', '### Skywalking\n\nskywalking 是一个观测性分析平台(OAP)和应用性能管理系统(APM)\n\n提供分布式链路追踪,服务网格.遥测分析.度量聚合和可视化一体化解决方案\n\n###### 特点:\n\n1 多语言自动探针, 无侵入(不需要修改代码)\n\n2 多种监控手段\n\n3 轻量高效 不需要额外搭建大数据平台\n\n4 模块化架构 UI 存储 集群管理多种机制可选\n\n5 支持告警\n\n6 优秀的可视化效果\n\n### 搭建skywalking\n\n###### 1 配置es\n\n###### 2 配置skywalking\n\n###### 3 重新启动服务并带上agent探针参数\n\n```\njava -javaagent:/usr/local/skywalking/apache-skywalking-apm-bin/agent-boot/skywalking-agent.jar -jar Fantasy-Blog-0.0.1-SNAPSHOT.jar &\n```\n\n[05-环境搭建-skywalking环境搭建_哔哩哔哩_bilibili](https://www.bilibili.com/video/BV1ZJ411s7Mn?p=5&spm_id_from=pageDriver&vd_source=c9cd8716686112a2fc4b64f8714fa2df)\n\n###### 效果\n![效果](https://img1.baidu.com/it/u=1632453353,3198763127&fm=253&fmt=auto&app=138&f=JPEG?w=1094&h=500)\n\n\n\n可以了解到哪一个接口很慢,定位到具体方法\n\n\n###### 1 如果显示500 zuul连接失败,说明oapservice没有正常启动\n\n\n\n###### 2 如果返回200  返回拒绝连接 说明es没有正常启动\n\n', 'skywalking 是一个观测性分析平台(OAP)和应用性能管理系统(APM)\n\n提供分布式链路追踪,服务网格.遥测分析.度量聚合和可视化一体化解决方案', b'1', b'0', b'1', b'1', '2025-01-21 16:59:24', '2025-01-21 15:44:42', 4, 200, 1, 3, b'0', '', 1);
INSERT INTO `blog` VALUES (9, '如何正确操作linux防火墙', 'https://pics1.baidu.com/feed/902397dda144ad3442661cc37da2fbfd30ad85a7.jpeg@f_auto?token=bf16daebf5fd0ca1dc7ab8e9bc284e29', '###### 1 查看防火墙状态\n\n```\n sudo systemctl status firewalld\n```\n\nactive (running) 表示已开启\n\n###### 2 开启防火墙\n\n```\nsudo systemctl start firewalld\n```\n\n###### 3 查看是否开放端口\n\n```\nfirewall-cmd --zone=public --query-port=8080/tcp\n```\n\n###### 4 开放指定端口\n\n```\nfirewall-cmd --permanent --zone=public --add-port=8080/tcp\n```\n\n###### 5 重启防火墙\n\n```\nfirewall-cmd --reload\n```\n\n 附带查看端口\n```\nnetstat -tnlp | grep :80\n\n```\n', 'linux防火墙', b'1', b'0', b'1', b'1', '2025-01-21 17:22:05', '2025-02-27 12:12:03', 0, 30, 0, 3, b'0', '', 1);
INSERT INTO `blog` VALUES (10, '从发出http请求到服务器响应全过程', 'https://img1.baidu.com/it/u=2769530473,3462589378&fm=253&fmt=auto&app=138&f=JPEG?w=500&h=349', '##### [从发出http请求到服务器响应过程 (baidu.com)](https://baijiahao.baidu.com/s?id=1761235726046024334&wfr=spider&for=pc)\n\n###### 1 用户输入url,浏览器内部将url进行拆分解析\n\n\n###### 2 浏览器对url进行解析后,浏览器确定了Web服务器和文件名,接下来就是根据这些信息来构造http请求报文\n\n请求报文和响应报文都是由请求行 + 消息头 + 消息体 三个部分组成 ,以换行符进行分割\n\n请求行会有区别\n\n请求报文: 请求行 = 方法 + url + 版本\n\n响应报文: 请求行 = 版本 + 状态码 + 短语\n\n\n###### 3 域名解析过程\n\n在发给服务器之前 , 还需要查询域名对应的IP地址,因为操作系统发送消息时,必须提供通信对象的IP地址\n\nDNS就是专门用来保存域名与IP的对应关系,负责解析域名的服务器\n\n解析过程 : \n\n1 首先查看电脑上的DNS缓存,如果有就解析完毕\n\n2 没有缓存就向本地DNS服务器发送一个DNS请求,询问域名对应的IP地址\n\n3 本地DNS收到后,把结果返回给客户端,并缓存起来\n\n\n\n浏览器拿到了服务器IP,接下来就是网络通信\n\n##### 二: 网络通信\n\n应用层,传输层,网络层,数据链路层\n\n\n\n###### 应用层: 首先由客户端发送HTTP请求\n\n###### 传输层: 传输层TCP传输报文\n\n位于传输层的TCP协议为传输报文提供可靠的字节流服务\n\nTCP协议通过三次握手等方法来保证传输的安全和可靠\n\n###### 三次握手\n\n客户端将发送一个带SYN给服务端  SYN\n\n服务端发送一个SYN和ACK给客户端 SYN+ACK\n\n客户端再回传一个带ACK的数据包确认连接 ACK\n\nSYN: 同步序列编号\n\nACK: 确认字符\n\n###### 网络层: IP协议查询MAC地址\n\nIP协议的作用是把TCP分割好的各种数据包传送给接收方.而要保证确实能传到接收方还需要接收方的MAC地址,也就是物理地址\n\n###### 数据链路层\n\n在找到对方的Mac地址后,就将数据发送到数据链路层传输,此时,客户端发送请求的阶段结束\n\n\n\n##### 三: 服务端响应请求\n\n服务端接收到客户端发送的http请求后,查找客户端请求的资源,并返回响应报文\n\n最后,服务端返回响应文件,通过WEB服务器,返回给浏览器客户端\n\n\n\n###### 四次挥手\n\nFIN\n\nACK\n\nFIN\n\nACK\n\n\n\n\n浏览器根据html构建dom树，cssom树，加载资源', '![](https://img1.baidu.com/it/u=2769530473,3462589378&fm=253&fmt=auto&app=138&f=JPEG?w=500&h=349)', b'1', b'1', b'1', b'1', '2025-01-21 17:26:16', '2025-01-21 14:56:35', 0, 300, 2, 3, b'0', '', 1);
INSERT INTO `blog` VALUES (11, 'Docker之kafka安装', 'https://img1.baidu.com/it/u=189839430,986155820&fm=253&app=138&size=w931&n=0&f=JPEG&fmt=auto?sec=1694019600&t=23d9d662c170d60d3445dceb7ec87a65', '\n安装准备\nzookeeker: docker pull zookeeper:latest\nkafka: docker pull wurstmeister/kafka:latest\n\n启动zookeeper\ndocker run -d --name zookeeper --publish 2181:2181 --volume /etc/localtime:/etc/localtime zookeeper:latest\n\n启动kafa\n#查看主机ip\n#当前我主机的ip是192.168.112.12\nifconfig\n \n\n#启动容器\n#这个地方，需要设定当前机器的ip\n```\ndocker run -d --name kafka --publish 9092:9092  --link zookeeper  --env KAFKA_ZOOKEEPER_CONNECT=zookeeper:2181  --env KAFKA_ADVERTISED_HOST_NAME=192.168.112.12  --env KAFKA_ADVERTISED_PORT=9092  --volume /etc/localtime:/etc/localtime  wurstmeister/kafka\n\n```\n\n\n\n#进入容器\n```\ndocker exec -it ${CONTAINER ID} /bin/bash\n\n\n```\n#创建topic\n#cd /opt/kafka_2.11-1.1.0/\ncd /opt/kafka_**\n\n#创建一个topic\n#zookeeper:2181 zookeeper服务的地址\nbin/kafka-topics.sh --create --zookeeper zookeeper:2181 --replication-factor 1 --partitions 1 --topic test\n\n#查看topic的列表\n```\nbin/kafka-topics.sh --list --zookeeper zookeeper:2181\n\n\n```\n\n启动容器，并进入这个容器中，需要注意的是容器的ip地址是当前机器的ip地址。\n\nDocker之kafka安装-yellowcong_docker\n\n\n\n可以看到，队列里面有一个test的topic\n\nDocker之kafka安装-yellowcong_docker_02\n\n测试kafka\n#向kafka发送测试消息\n#输入一些测试消息。\nbin/kafka-console-producer.sh --broker-list localhost:9092 --topic test\n\n#消费消息\n#\n运行一个消息消费者，同样指定 topic 为 test，可以接收到生产者发送的消息。\n```\nbin/kafka-console-consumer.sh --bootstrap-server localhost:9092 --topic test --from-beginning\n\n\n```\n\n\n#描述topic的信息\n ./bin/kafka-topics.sh --describe --zookeeper zookeeper:2181 --topic test\n\n#查看消息消费条数\nbin/kafka-run-class.sh kafka.tools.GetOffsetShell --broker-list localhost:9092 --topic test --time \n查看test这个topic的信息\n\nDocker之kafka安装-yellowcong_zookeeper_03\n\n查看test这个topic消费的消息条数\n\nDocker之kafka安装-yellowcong_kafka_04\n\n启动多个实例\n启动多个的情况\n\n登录后复制 \n#我们需要更改 端口指向即可\ndocker run -d --name zookeeper2 --publish 2182:2181 --volume /etc/localtime:/etc/localtime zookeeper:latest\n#对于kafka  link了 zookeeper2  容器 直接使用容器端口，而不是宿主机映射端口。\ndocker run -d --name kafka2 --publish 9093:9092  --link zookeeper2  --env KAFKA_ZOOKEEPER_CONNECT=zookeeper2:2181  --env KAFKA_ADVERTISED_HOST_NAME=192.168.112.12  --env KAFKA_ADVERTISED_PORT=9093  --volume /etc/localtime:/etc/localtime  wurstmeister/kafka\n\n参考文章\n  https://www.jianshu.com/p/263164fdcac7', '\n通过docker安装kafka，对于开发者可以快速的搭建测试开发环境，是一个非常好方案，不需要手动的去下载安装包，修改配置文件，注意：这种方法只适用于开发和测试，生产环境禁用，由于docker重启后，挂载数据卷目录启动的服务不一定好用，数据容易丢失掉了。', b'1', b'0', b'1', b'1', '2025-01-05 14:42:01', '2025-01-21 14:53:38', 0, 1000, 5, 3, b'0', '', 1);
INSERT INTO `blog` VALUES (12, 'Debug常规操作总结', 'https://img0.baidu.com/it/u=3570543349,3746383673&fm=253&fmt=auto&app=138&f=PNG?w=500&h=313', '[【Debug常规操作总结】_debug回退上一步-CSDN博客](https://blog.csdn.net/qq_53859178/article/details/127241195)\n\n###### 1 回退上一步\n![1](http://106.14.45.117:8090/admin/download?name=1)\n\n![1](http://106.14.45.117:8090/admin/download?name=1)\n\n\n新版本改为 Reset Frame 回到调用方法前栈针位置\n\n![image-20240227091623741](http://106.14.45.117:8090/admin/download?name=image-20240227091623741)\n\n\n\n\n\n###### 2 检测属性值修改\n\n在属性上打个标记 眼睛，当属性被修改时就会自动断点到修改处\n\n![image-20240227094148452](http://106.14.45.117:8090/admin/download?name=image-20240227094148452)\n\n\n\n###### 3 Stream流的调试\n\nTrace Current Stream Chain   。  需要使用Java Stream Debugger插件\n\n![image-20240227095755637](http://106.14.45.117:8090/admin/download?name=image-20240227095755637)\n\n\n\n![image-20240227095736181](http://106.14.45.117:8090/admin/download?name=image-20240227095736181)\n\n\n\n###### 4. 表达式计算结果查看或修改属性值\n\n对于一些表达式的值并不会默认展示 使用表达式计算可以查看或修改值\n\nalt + f8\n\n![image-20240227102218353](http://106.14.45.117:8090/admin/download?name=image-20240227102218353)\n\n\n\n###### 5. debug筛选条件\n\n![image-20240227102855248](http://106.14.45.117:8090/admin/download?name=image-20240227102855248)\n\n\n\n###### 6. 异常断点\n\n因此我们想要当异常发生的时候可以停在抛异常的地方，方便我们进行问题定位。\n\n![image-20240227104111110](http://106.14.45.117:8090/admin/download?name=image-20240227104111110)\n\n搜索错误类型并添加，之后在debug过程中，如果遇到空指针，他就会给你标识出具体代码行\n\n\n\n```\n\n    public static int i = 1;\n\n    public static void main(String[] args) {\n        System.out.println(1);\n        System.out.println(2);\n        t1();\n        i = 2;\n        List<Integer> list = new ArrayList<>();\n        list.add(1);\n        list.add(2);\n        list.add(3);\n        list.add(4);\n        list.add(5);\n        long count = list.stream()\n                .map(e -> e + 3)\n                .filter(e -> e % 2 == 0)\n                .count();\n        for (Integer integer : list) {\n            if (integer % 2 == 0){\n                System.out.println(integer);\n            }\n        }\n        System.out.println(count);\n    }\n\n    public static void t1(){\n        System.out.println(4);\n    }\n```\n\n', 'Debug常规操作总结', b'1', b'0', b'1', b'1', '2025-01-24 13:53:35', '2025-01-21 14:53:53', 0, 200, 1, 3, b'0', '', 1);
INSERT INTO `blog` VALUES (16, '年底爆火的恐怖游戏《米塔》（MiSide）好玩在哪？', 'https://t10.baidu.com/it/u=3030532406,256221795&fm=30&app=106&f=JPEG?w=312&h=208&s=F380FA0E505087D24298BE9F03001085', '[《米塔》（MiSide）](https://baike.baidu.com/item/%E7%B1%B3%E5%A1%94/65067891)\n2024年12月11日发售至今，《米塔》（MiSide）已经在Steam平台斩获了超过3万条评价。这个只有两人制作、看起来也很“简陋”的游戏，堪称2024年小体量作品中最意想不到的黑马之一。\n\n![MiSide](http://106.14.45.117:8055/common/upload1/download?name=d2be116e-aeff-44ca-a829-12c215dfdc88MiSide.png)\n\n很多大作都没这个成绩\n\n《米塔》同样获得了大批国内玩家的肯定，中文评价与总评一度达到了9000:20000，占到了将近一半。在B站，不少《米塔》主题的视频也达到了百万播放量，堪称“破圈”。12月末，游戏在欧美地区也获得了不俗销量。总体来说，《米塔》成了一次世界级的小众狂欢。\n\n那么，《米塔》为何能有如此成绩呢？\n\n\n一段足够优质的互动体验，真的胜过看电影\n\n![](http://106.14.45.117:8055/common/upload1/download?name=e9ed501d-0e97-4710-b4b1-01f49d867d98MiSide2.png)\n\n\n收敛式恐怖\nSteam商店页面中，《米塔》被打上了“恐怖”和“心理恐怖”的标签。游戏中确实存在恐怖元素，并以此作为宣传点。但在体验完整个游戏后，我却产生了一丝《米塔》“是否该算恐怖游戏”的疑问。\n\n之所以会这么说，是因为《米塔》对恐怖内容进行了“收敛式”设计。以一个可量化的指标为例，0.91版本更新后，游戏全篇分为19个小段落，其中只有8段含有恐怖内容，其余的都是“安全区间”。如果按游戏全部时长来更细致地划分，恐怖元素的占比恐怕会更低。\n\n\n大部分时候都让人很放松很舒适\n\n打个比方，你可以想象一下，《生化危机2》里原本怪物横行的警局关卡不仅怪物都消失了，还存在着不止有一位友好NPC的巨大安全屋——这就是《米塔》的设计方式。\n\n《米塔》的这种收敛式思路，反而很好地解决了一直以来恐怖游戏存在的一个困局。早在2019年，我就曾经在《直播时代：恐怖游戏的新难题》一文中，提及过恐怖游戏在直播时代普遍存在“盲目堆砌恐惧元素导致劝退普通玩家”的问题，最终在循环影响下，大多数普通玩家干脆不敢买了；感兴趣的人，也转而关注“主播受虐”，顺带了解游戏内容，而非自己上手。\n\n\n玩着舒坦就是舒坦\n\n![](http://106.14.45.117:8055/common/upload1/download?name=03ac67a8-a3b8-4ca9-9b41-ba623c2c95fbMiSide4.png)\n\n\n《米塔》没有采取这种做法，尽管它其实相当适合类似的方式——《米塔》讲述了一个玩家掉入游戏世界、被本该是游戏角色的米塔反制的故事，从剧情上看，让“米塔”不断追逐玩家甚至很合理，游戏却偏偏在这一点上做到了克制，或许也算是一种扬长避短。\n\n在这方面，还有一款游戏可以作为对比，那就是2023年的《Love Love School Days》。这款游戏在小圈子内颇有名声，其中就有无敌追踪型敌人全程“陪伴”玩家的设计。从数据上，我们能直观对比出两个游戏的差距。\n\n\n这款游戏虽然也别具匠心，但玩起来真的闹心，而且显然不止我这么觉得\n\n虽然《米塔》也有追逐战桥段，但玩家能明显感觉到，制作者更多想表达的是出于致敬或是某种解构式的调侃才这么设计的。有些段落，如果玩家能反应出设计的含义，甚至在几秒钟就能将其结束，这个时间长度对一些神经略粗的玩家来说，可能都来不及觉得恐惧。\n\n同时，这些桥段又不会显得“力度不够”。作为恐怖游戏老手，我在《米塔》游戏流程中也被刺激到，至少发出过一次“哇哦”的感叹。除了恐惧，也有对它在细节上做出小创新的赞叹——是的，《米塔》不仅对恐怖游戏的传统框架做了调整，细节处也有别具匠心的“小花样”。\n\n\n就像这些地方，表达方式更艺术，能让玩家觉得有人跟着，感到恐惧\n\n这也是《米塔》最明显的优点。在内容方面，它既保留了充分的恐怖元素，能让玩家感到害怕，又几乎完全摒弃了许多传统同类游戏中让人“过度不适”的部分，不拿蹩脚的玩法恶心玩家，再加上细节上的诸多小心意，不禁让我感慨——也许这才是如今玩家想要的恐怖游戏体验。\n\n\n恐怖游戏经典的“木头人”当然有，但你绝想不到开发者做出怎样“温柔”的设计\n\n二次元的表达\n随着近年国内二游大发展，“什么才算二次元”这个充满哲学意味的探讨也一直持续着。尽管各家观点不同，但在大方向上仍然有些共识。比如说，对“二次元”的诠释需要涵盖多个方面，绝不是有大眼睛、夸张身材比例的俊男美女外观就可以了。\n\n无论是有意还是无心，《米塔》恰好抓到了主流市场对“二次元普遍流于表面地诠释”这一现状的时间点，利用船小好调头的优势，做出了各种大厂肯定不会做，玩家们又久候的内容——比如跟“与美少女互动”这个好理解的细节。\n\n\n“第一次和妹子牵着手”\n\n![](http://106.14.45.117:8055/common/upload1/download?name=68a257d4-fb60-4ca6-b756-4abc149ed041MiSide3.png)\n\n\n在二次元文化中，虚构形象通过与玩家互动来建立情感联系，是非常重要的一环。这些互动可以有许多发挥空间，最常见的一种是角色根据玩家游戏中的行为进行语言上的反馈。到了手游时代，由于触摸屏的普及，“戳角色”几乎成了新的标配功能。\n\n\n原文来自：[https://baijiahao.baidu.com/s?id=1820222140272973922&wfr=spider&for=pc](https://baijiahao.baidu.com/s?id=1820222140272973922&wfr=spider&for=pc)', '本文将讲述米塔为什么这么受玩家欢迎', b'1', b'1', b'1', b'1', '2025-01-21 15:34:53', '2025-01-21 15:34:53', 10000, 3000, 15, 1, b'0', '', 1);
INSERT INTO `blog` VALUES (17, '国产3a游戏《黑神话：悟空》横空出世，销量超2800万', 'http://101.34.137.166:8055/common/upload1/download?name=4810acbf-f8e9-491d-be7e-7d57cd3e7eccOIP-C.jpg', '备受瞩目的国产游戏《黑神话：悟空》再创佳绩，其销量已经突破2800万份，销售额更是高达90亿元人民币。这一数据不仅彰显了该游戏在国内市场的巨大影响力，也使其成为国产买断制游戏历史上的销量冠军，并成功跻身全球年度销量第一的行列。\n![](http://106.14.45.117:8055/common/upload1/download?name=9345afa9-73f2-4cad-99e7-70496683f7e7WuKong.png)\n\n\n《黑神话：悟空》由游戏科学公司出品，以其精美的画面、独特的剧情和丰富的角色设计赢得了广大玩家的喜爱。随着游戏角色设计的不断深化和剧情层次的递进，玩家能够体验到身临其境的沉浸感，这也是该游戏在众多作品中脱颖而出的重要原因。\n\n2024年，国产买断制游戏市场迎来了爆发式增长，全年总销售额约为102.2亿元人民币，同比增长高达398.5%。在这一背景下，《黑神话：悟空》的成功并非偶然，而是凭借其出色的品质和口碑赢得了市场的广泛认可。\n![](https://zkres1.myzaker.com/202501/678e712bb15ec05cf3389e6b_1024.jpg)', '国产3a游戏《黑神话：悟空》横空出世，销量超2800万', b'1', b'1', b'1', b'1', '2025-01-21 17:04:18', '2025-03-16 12:50:25', 100000, 1000, 5, 1, b'0', '', 1);
