INSERT INTO `game` VALUES (1, '只狼', 'FromSoftware', 'FromSoftware', '2019-03-22 00:00:00', NULL, 'https://store.steampowered.com/agecheck/app/814380/', 'https://store.steampowered.com/agecheck/app/814380/', 'https://fc1tn.baidu.com/it/u=1368028410,1648972565&fm=202&mola=new&crop=v1', '<p>《只狼：影逝二度》（Sekiro：Shadows Die Twice）是一款由From Software制作的第三人称视角的动作冒险RPG类游戏，玩家将操控一位忍者，拯救他的主人——拥有日本贵族血统的大能的御子，并向他的天敌复仇。\n2019最佳年度游戏</p>\n', b'1', b'0', b'0', b'1', 0, 0, 1, b'0', '', '2025-01-02 15:20:50', '2025-01-02 15:20:54');
INSERT INTO `game` VALUES (6, '燕云十六声', 'EVERSTONE', '网易', '2024-12-27 00:00:00', '', 'https://www.yysls.cn/', 'https://www.yysls.cn/', 'http://106.14.45.117:8055/common/upload/download?name=fd23a292-92cc-4642-be4d-294768d215971735524816721_IMG_20241230_101328.png&dir=很烦', '<p>《燕云十六声》是一款由Everstone工作室开发的动作角色扮演游戏，于2024年12月27日进行公测。\n游戏的故事背景设定在五代十国与宋代的交替之时，玩家作为一名侠客，开启属于自己的武侠故事。</p>\n', b'1', b'0', b'0', b'1', 1000, 10, 2, b'0', '', '2025-01-06 19:19:01', '2025-01-07 16:30:21');
