INSERT INTO `operation_log` VALUES (8, 'Admin', '/admin/friendInfo/content', 'PUT', '{\"map\":{\"content\":\"随机排序，不分先后。欢迎交换友链~(￣▽￣)~*\\n\\n* 昵称：Fantasy\\n* 一句话：游龙当归海，海不迎我自来也。\\n* 网址：[https://naccl.top](https://naccl.top)\\n* 头像URL：[https://naccl.top/img/avatar.jpg](https://naccl.top/img/avatar.jpg)\\n\\n仅凭个人喜好添加友链，请在收到我的回复邮件后再于贵站添加本站链接。原则上已添加的友链不会删除，如果你发现自己被移除了，恕不另行通知，只需和我一样做就好。\\n\\n\"}}', '修改友链页面信息', '192.168.138.1', '内网IP|内网IP', 'Windows 10', 'Edge 110.0.0.0', 4, '2023-03-01 22:52:56', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/110.0.0.0 Safari/537.36 Edg/110.0.1587.57');
